import React, { useEffect } from "react";
import { Button, Form, Input } from "antd";
import "./supplier.css";
import { getData } from "../../api";

const Supplier = () => {
  useEffect(() => {
    getData().then();
  }, []);

  // add new supplier
  const handleClick = () => {};
  // submit form
  const handleFinisch = (e) => {
    console.log(e);
  };
  const getTableData = () => {};
  useEffect(() => {
    // get supplier data from backend
    getTableData();
  }, []);
  return (
    <div className="supplier">
      <div className="flex-box space-between">
        <Button
          type="primary"
          onClick={() => {
            handleClick("add");
          }}
        >
          +Add Supplier
        </Button>
        <Form layout="inline" onFinish={handleFinisch}>
          <Form.Item name="keyword">
            <Input placeholder="Please enter supplier name"></Input>
          </Form.Item>
          <Form.Item>
            <Button htmlType="submit" type="primary">
              Search
            </Button>
          </Form.Item>
        </Form>
      </div>
    </div>
  );
};

export default Supplier;
